import { Injectable } from '@angular/core';
import { Student } from '../../models/student';
import { STUDENTS } from '../../mocks/student.mock';

@Injectable({
  providedIn: 'root'
})
export class StudentService {

  students: Student[] = STUDENTS;

  getStudents(): Student[] {
    return this.students;
  }
}
